function buildK_withquadrature(tet)

        
    if !isfile("rebuildK_quadrature.jld")
        println("Rebuilding K with quadrature")    
        
        r,s,t = symbols("r s t")    
        phi = buildPhi((r,s,t),tet)
        npts = length(phi)

        d_Phi_rr = zeros(npts,npts)
        d_Phi_rs = zeros(npts,npts)
        d_Phi_rt = zeros(npts,npts)
        d_Phi_ss = zeros(npts,npts)
        d_Phi_st = zeros(npts,npts)
        d_Phi_tt = zeros(npts,npts)

        p = Progress(npts,5)
        
        for i=1:npts
            d_phi_i_r = diff(phi[i],r)        
            d_phi_i_s = diff(phi[i],s)
            d_phi_i_t = diff(phi[i],t)
            d_phi_i_r_n = zeros(npts)
            d_phi_i_s_n = zeros(npts)
            d_phi_i_t_n = zeros(npts)
            for n=1:npts
                d_phi_i_r_n[n] = subs(d_phi_i_r,(r,tet.r[n]),(s,tet.s[n]),(t,tet.t[n]))
                d_phi_i_s_n[n] = subs(d_phi_i_s,(r,tet.r[n]),(s,tet.s[n]),(t,tet.t[n]))
                d_phi_i_t_n[n] = subs(d_phi_i_t,(r,tet.r[n]),(s,tet.s[n]),(t,tet.t[n]))
            end
            
            for j=1:npts
                d_phi_j_r = diff(phi[j],r)
                d_phi_j_s = diff(phi[j],s)
                d_phi_j_t = diff(phi[j],t)

                d_phi_j_r_n = zeros(npts)
                d_phi_j_s_n = zeros(npts)
                d_phi_j_t_n = zeros(npts)
                for n=1:npts
                    d_phi_j_r_n[n] = subs(d_phi_j_r,(r,tet.r[n]),(s,tet.s[n]),(t,tet.t[n]))
                    d_phi_j_s_n[n] = subs(d_phi_j_s,(r,tet.r[n]),(s,tet.s[n]),(t,tet.t[n]))
                    d_phi_j_t_n[n] = subs(d_phi_j_t,(r,tet.r[n]),(s,tet.s[n]),(t,tet.t[n]))
                end

                # integral(phi*phi) =~= m_k*sum(q_k.*(phi.*phi)) (m_k=1/6)
                # sum written using dot product
                d_Phi_rr[i,j] = 6*dot(d_phi_i_r_n .* d_phi_j_r_n,1/6*tet.quadrature_weights)

                exact_d_Phi_rr = 6*integrate(d_phi_i_r*d_phi_j_r,(r,0,1-s-t),(s,0,1-t),(t,0,1))

                println("exact vs. quadrature = $(exact_d_Phi_rr) vs. $(d_Phi_rr[i,j])")

                d_Phi_rs[i,j] = dot(d_phi_i_r_n .* d_phi_j_s_n,1/6*tet.quadrature_weights)
                d_Phi_rt[i,j] = dot(d_phi_i_r_n .* d_phi_j_t_n,1/6*tet.quadrature_weights)
                d_Phi_ss[i,j] = dot(d_phi_i_s_n .* d_phi_j_s_n,1/6*tet.quadrature_weights)
                d_Phi_st[i,j] = dot(d_phi_i_s_n .* d_phi_j_t_n,1/6*tet.quadrature_weights)
                d_Phi_tt[i,j] = dot(d_phi_i_t_n .* d_phi_j_t_n,1/6*tet.quadrature_weights)
                
            end
            next!(p)
        end
        
        # take advantage of symmetry
        d_Phi_sr = d_Phi_rs'
        d_Phi_tr = d_Phi_rt'
        d_Phi_ts = d_Phi_st'

        jldopen("rebuildK_quadrature.jld","w") do file
            
            write(file,"d_Phi_rr",d_Phi_rr)
            write(file,"d_Phi_rs",d_Phi_rs)
            write(file,"d_Phi_rt",d_Phi_rt)
            write(file,"d_Phi_ss",d_Phi_ss)
            write(file,"d_Phi_st",d_Phi_st)
            write(file,"d_Phi_tt",d_Phi_tt)
            write(file,"d_Phi_sr",d_Phi_sr)
            write(file,"d_Phi_tr",d_Phi_tr)
            write(file,"d_Phi_ts",d_Phi_ts)
            
        end

        return Tetrahedra(3,length(tet.r),tet.r,tet.s,tet.t,tet.quadrature_weights,tet.cfl_factor,
                              d_Phi_rr,d_Phi_rs,d_Phi_sr,d_Phi_rt,d_Phi_tr,d_Phi_ss,d_Phi_st,d_Phi_ts,d_Phi_tt,
                              tet.EToV_local)
        
    else

        println("Loading K built with quadrature")
        
        jldopen("rebuildK_quadrature.jld","r") do file
            
            d_Phi_rr = read(file,"d_Phi_rr")
            d_Phi_rs = read(file,"d_Phi_rs")
            d_Phi_rt = read(file,"d_Phi_rt")
            d_Phi_ss = read(file,"d_Phi_ss")
            d_Phi_st = read(file,"d_Phi_st")
            d_Phi_tt = read(file,"d_Phi_tt")
            d_Phi_sr = read(file,"d_Phi_sr")
            d_Phi_tr = read(file,"d_Phi_tr")
            d_Phi_ts = read(file,"d_Phi_ts")

            return Tetrahedra(3,length(tet.r),tet.r,tet.s,tet.t,tet.quadrature_weights,tet.cfl_factor,
                              d_Phi_rr,d_Phi_rs,d_Phi_sr,d_Phi_rt,d_Phi_tr,d_Phi_ss,d_Phi_st,d_Phi_ts,d_Phi_tt,
                              tet.EToV_local)
                        
        end
    end
    
end

