function nodes_and_weights_tetP2()

    # reference weights from MJS Chin-Joe-Kong et al (1999)
    # weights are given based on reference triangle with V=1/6, which need to be normalized
    w0 = (13-3*sqrt(13))/10080*6 # corners 4
    wa = (4-sqrt(13))/315*6 # edges 6
    wb = (29+17*sqrt(13))/10080*6 # faces 12
    wc = (16/315)*6 # center 1

    quadrature_weights = [w0, w0, w0, w0, # corners
                          wa, wa, wa, wa, wa, wa, # edges
                          wb, wb, wb, wb, wb, wb, # faces...
                          wb, wb, wb, wb, wb, wb, # faces
                          wc] # center

    RST = np.load("RST_p2tetrahedra.npz")
    r = get(RST,"r")
    s = get(RST,"s")
    t = get(RST,"t")

    (quadrature_weights,r,s,t)
    
end
    
function nodes_and_weights_tetP3()
    # reference weights from MJS Chin-Joe-Kong et al (1999)
    # weights are given based on reference triangle with V=1/6, which need to be normalized
    w0 = 0.2143608668049743e-03*6
    wa = 0.8268179517797114e-03*6
    wb1 = 0.1840177904191860e-02*6
    wb2 = 0.1831324329245650e-02*6
    wg = 0.7542468904648131e-02*6
    wd = 0.1360991755970793e-01*6
    
    quadrature_weights = np.asarray([w0, w0, w0, w0,
                                     wa, wa, wa, wa,
                                     wa, wa, wa, wa,
                                     wa, wa, wa, wa,
                                     wb1, wb1, wb1, wb1,
                                     wb1, wb1, wb1, wb1,
                                     wb1, wb1, wb1, wb1,
                                     wb2, wb2, wb2, wb2,
                                     wb2, wb2, wb2, wb2,
                                     wb2, wb2, wb2, wb2,
                                     wg, wg, wg, wg,
                                     wd, wd, wd, wd, wd, wd])

    if isfile("M_p3tetrahedra.npz")
        Ml = np.load("M_p3tetrahedra.npz")
        M = get(Ml,"M")

        quadrature_weights_new = zeros(length(quadrature_weights))
        for i=1:length(quadrature_weights)
            quadrature_weights_new[i] = sum(M[i,:])
        end
        
        diff_paper_vs_recomputed = abs(quadrature_weights - quadrature_weights_new)
        println("max = $(maximum(diff_paper_vs_recomputed)) of $(diff_paper_vs_recomputed)")

        println("M[1,1:3]=$(M[1,1:3])")
        println("quadalt[1]=$(quadrature_weights_new[1])")
        println("quadrature_weights[47] = $(quadrature_weights[47])")
        
    end
        
    println("Reloading (r,s,t) for P3")
    RST = np.load("RST_p3tetrahedra.npz")
    r = get(RST,"r")
    s = get(RST,"s")
    t = get(RST,"t")
    
    return (quadrature_weights,r,s,t)
end

